import { repeaterData, RepeaterControl } from './gutenberg-repeater-control/index.js';

const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText, InspectorControls } = wp.blockEditor;
const {
  PanelBody,
  PanelRow,
  TextControl,
  TextareaControl
} = wp.components;

registerBlockType("gb/offsetwithsupportingtext", {
  title: __("Offset With Supporting Text", "GB"),
  icon: (
    <img src="data:image/png;base64," />
  ),
  category: "faq",
  attributes: {
    hidden: {
      type: "string|array", // It's a string when persisted but when working on gutenberg it's an array
      source: "attribute",
      selector: "select",
      attribute: "hidden",
      default: [],
    },
    contentUD: { type: "string", default: `Frequently asked questions` },
    contentUA: {
      type: "string",
      default: `Cant find the answer youre looking for? Reach out to our `,
    },
    contentUB: { type: "string", default: `customer support` },
    contentUC: { type: "string", default: ` team.` },
    contentt: { type: "string", default: `How do you make holy water?` },
    contentUE: {
      type: "string",
      default: `You boil the hell out of it. Lorem ipsum dolor sit amet consectetur adipisicing elit. Quas cupiditate laboriosam fugiat.`,
    },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <div className="bg-white">
        <InspectorControls>
          <PanelBody title="Block settings">
            <PanelRow>
              <b>FAQ's</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={10}
                value={props.attributes.hidden}
                onChange={(val) => {
                  props.setAttributes({ hidden: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Question"
                      value={value.question}
                      onChange={(v) => {
                        value.question = v;
                        onChange(value);
                      }}
                    />,
                    <TextareaControl
                      label="Answer"
                      value={value.answer}
                      onChange={(v) => {
                        value.answer = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
          </PanelBody>
        </InspectorControls>
        <div className="max-w-7xl mx-auto py-16 px-4 sm:px-6 lg:py-20 lg:px-8">
          
          <div className="lg:grid lg:grid-cols-3 lg:gap-8">
            
            <div>
              
              <h2 className="text-3xl font-extrabold text-gray-900">
                <RichText
                  value={attributes.contentUD}
                  default={"Frequently asked questions"}
                  onChange={(newtext) =>
                    setAttributes({ contentUD: newtext })
                  }
                />
              </h2>
              <p className="mt-4 text-lg text-gray-500">
                <RichText
                  value={attributes.contentUA}
                  default={
                    "Cant find the answer youre looking for? Reach out to our "
                  }
                  onChange={(newtext) =>
                    setAttributes({ contentUA: newtext })
                  }
                />
                <a
                  href="#"
                  className="font-medium text-indigo-600 hover:text-indigo-500"
                >
                  <RichText
                    value={attributes.contentUB}
                    default={"customer support"}
                    onChange={(newtext) =>
                      setAttributes({ contentUB: newtext })
                    }
                  />
                </a>
                <RichText
                  value={attributes.contentUC}
                  default={" team."}
                  onChange={(newtext) =>
                    setAttributes({ contentUC: newtext })
                  }
                />
              </p>
            </div>
            <div className="mt-12 lg:mt-0 lg:col-span-2">
              
              <dl className="space-y-12">

              {arData.map((v) => {
                return (
                  <div>
                  
                  <dt className="text-lg leading-6 font-medium text-gray-900">
                    {v.question}
                  </dt>
                  <dd className="mt-2 text-base text-gray-500">
                    {v.answer}
                  </dd>
                </div>
                )
              })}

              </dl>
            </div>
          </div>
        </div>
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <div class="bg-white">
        
        <div class="max-w-7xl mx-auto py-16 px-4 sm:px-6 lg:py-20 lg:px-8">
          
          <div class="lg:grid lg:grid-cols-3 lg:gap-8">
            
            <div>
              
              <h2 class="text-3xl font-extrabold text-gray-900">
               <RichText.Content value={attributes.contentUD}/>
              </h2>
              <p class="mt-4 text-lg text-gray-500">
                $1
                <a
                  href={
                    attributes.contentUB.match('(.*?)href="(.*?)"(.*?)')
                      ? attributes.contentUB.match(
                          '(.*?)href="(.*?)"(.*?)'
                        )[2]
                      : attributes.contentUB
                  }
                  class="font-medium text-indigo-600 hover:text-indigo-500"
                >
                  {attributes.contentUB.match("(?<=<.+.>)(.*?)(?=<.*/.+.?>)")
                    ? attributes.contentUB.match(
                        "(?<=<.+.>)(.*?)(?=<.*/.+.?>)"
                      )[0]
                    : attributes.contentUB}
                </a>
               <RichText.Content value={attributes.contentUC}/>
              </p>
            </div>
            <div class="mt-12 lg:mt-0 lg:col-span-2">
              
              <dl class="space-y-12">
                
                {arData.map((v) => {
                  return (
                    <div>
                    
                    <dt className="text-lg leading-6 font-medium text-gray-900">
                      {v.question}
                    </dt>
                    <dd className="mt-2 text-base text-gray-500">
                      {v.answer}
                    </dd>
                  </div>
                  )
                })}
              </dl>
            </div>
          </div>
        </div>
      </div>
    );
  },
});
